local failed = falseovel.randomize()for i = 0, 1000 do  local tmps = ""  for j = 0, math.random( 1, 30 ) do    tmps = tmps .. string.char( math.random( 0, 255 ) )  end  if ovel.uncompress( ovel.compress( tmps ) ) ~= tmps then    failed = true    break  endendtab = { 1, 2, 4, 0.000000002 }tab2 = { 4, { 1, "foo" }, 500000000000000 }tab.bar = tab2tab2[ 1 ] = tabtab[ tab ] = tabtab[ tab2 ] = tab2tab[ false ] = truetab2[ false ] = tab2tab2[ true ] = tabtab3 = ovel.unserialize( ovel.serialize( tab ) )tab4 = ovel.serialUncompress( ovel.serialCompress( tab ) )if not ovel.recursiveCompare( tab3, tab ) then failed = true endif not ovel.recursiveCompare( tab4, tab ) then failed = true endtmps = ""for i = 0, 33 do  local enc = ovel.asciiEncode( tmps )  local dec = ovel.asciiDecode( enc )  if tmps ~= dec then failed = true end  tmps = tmps .. string.char( math.random( 0, 255 ) )endif failed then  print( "\n\nFailed compression tests!" )else  print( "\n\nSuccesfully completed compression tests!" )end